import React from 'react';
import './lib/home.scss';
import LayoutHome from '../../layout/LayoutHome';
import Header from '../../common/skjheader/Header';
const newsList = [
  {
      id:'1',
      date:'21 Dec',
      year:'2018',
      img:'./images/world_finest.png',
      headline:'Skipjack Introduces Product of the World Fastest Financial Access',
      link:'https://m.timessingapore.com/read/1860/20181221/092854/skipjack-introduces-product-of-the-world-fastest-financial-access/'
  },
  {
      id:"2",
      date: '12 Mar',
      year: '2019',
      img:'./images/zetanet_application.png',
      headline:'Zetanet and Its Applications: A Quick Look',
      link:'https://moneyincrypto.com/2019/03/12/zetanet-and-its-applications-a-quick-look/?fbclid=IwAR1JCImf8_CrzGZCJ6qenhd8fDGMSWw2qSvnv7rD4hwZLdmHxlXICoJrxXM'
  },
  {
      id:'3',
      date:'14 Mar',
      year:'2019',
      img:'./images/why_zetanet.png',
      headline:'Why Zetanet?',
      link:'https://moneyincrypto.com/2019/03/14/why-zetanet/?fbclid=IwAR1XFZd8IEdacdaB3LdzstwUvlYLuCU93XZX2JCeRRO0iij38bEcIEdVyFc'
  },
  {
      id:'4',
      date:'14 Mar',
      year:'2019',
      img:'./images/token2049.png',
      headline:'SKIPJACK Corporation is a SILVER Sponsor in Hong Kong’s TOKEN 2049 Conference',
      link:'https://moneyincrypto.com/2019/03/14/skipjack-corporation-is-a-silver-sponsor-in-hong-kongs-token-2049-conference/'
  },
  {
      id:'5',
      date:'30 Aug',
      year:'2019',
      img:'./images/public_offering.png',
      headline:'SKIPJACK Corporation is a SILVER Sponsor in Hong Kong’s TOKEN 2049 Conference',
      link:'https://investing.thisismoney.co.uk/news/article/id/6567095?rnsAgreed=1'
  },
  {
      id:'6',
      date:'30 Aug',
      year:'2019',
      img:'./images/public_offering_1.jpg',
      headline:'Stankevicius MGM review: Skipjack Corp Starts Zetanet Public Offering',
      link:'https://www.londonstockexchange.com/exchange/news/market-news/market-news-detail/other/14207816.html'
  },
  {
      id:'7',
      date:'30 Aug',
      year:'2019',
      img:'./images/encryp-dominates.jpeg',
      headline:'Company Announcements Stankevicius MGM: Skipjack Corp Public Offering',
      link:'https://markets.ft.com/data/announce/detail?dockey=1323-14207816-62KB4GDP1E4ATE09GSVCR6HIMO'
  }
];
class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      tab: '',
      visible: 5,
      items: [],
    };
    this.loadMore = this.loadMore.bind(this);
  }
  handleCheck(e) {
    this.setState({ tab: e.currentTarget.textContent });
    console.log("a", e.currentTarget.textContent);
  }
  componentDidMount(){

    this.setState({ tab: 'News'});
  }
 loadMore() {
    this.setState((prev) => {
      return {visible: prev.visible + 1};
    });
  }

  render() {
    return (
      <div className="news page">
      <Header></Header>
        <div className="page-body-news" ref={this.myDivToFocusHome}>
          <div className="news-header-top">
            <div className="home-content">
                <LayoutHome contact={this.props.contact}></LayoutHome>
            </div>
          </div>
          <div className='news-tab'>
            <ul>
              <li className={this.state.tab === 'News' ? 'active': ''}   onClick={this.handleCheck.bind(this)}>
                News
              </li>
              <li className={this.state.tab === 'Events' ? 'active': ''}   onClick={this.handleCheck.bind(this)}>
                Events
              </li>
              <li className={this.state.tab === 'Media Gallery' ? 'active': ''}   onClick={this.handleCheck.bind(this)}>
                Media Gallery
              </li>
            </ul>
            <span className='curentTab'>{this.state.tab}</span>
          </div>

          <div className='news-detail' ref={this.props.data}>
                                   
            {newsList.slice(0, this.state.visible).map((item, index) => {
            return (
                        <div className='news-box' key={item.id}>
                            <div className='news-container'>
                                <a href={item.link}  target="_blank">
                                    <div className='news-date'>
                                        {item.date}<span>{item.year}</span>
                                    </div>
                                    <div className='headline-img'>
                                            <img src={item.img} className="news-logo" alt='logo'></img>
                                    </div>
                                    <span className="headline">
                                        {item.headline}
                                    </span>
                                </a>
                            </div>
                        </div>
                    );
                })} 
              {this.state.visible < newsList.length &&
                  <div class="load-more" onClick={this.loadMore}>Load more</div>
              } 
          </div>
        </div>
      </div>
    );
  }
}
export default Home;
